近澤製紙所は1953年に法人化した紙おむつメーカーで、大人用紙おむつを主力商品に、国内製紙メーカーからの委託生産（OEM）を手がけてきました。2018年には売上高約41億5000万円を計上していましたが、新型コロナの影響で海外向けの受注が減少したほか、大手製紙メーカーの内製化に伴い、OEMの受注が大幅に減少していたということです。
